const axios = require("axios");

axios({
    "method": "GET",
    "url": "https://skyscanner-skyscanner-flight-search-v1.p.rapidapi.com/apiservices/autosuggest/v1.0/%7Bcountry%7D/GBP/en-GB/",
    "headers": {
        'Content-Type': 'application/json',
        "x-rapidapi-host": "skyscanner-skyscanner-flight-search-v1.p.rapidapi.com",
        "x-rapidapi-key": "c573d899fbmsh7f790eccbfa07a7p17edf7jsnf6b3cf11be53",
        "useQueryString": true
    }, "params": {
        "query": "Stockholm",
        "country": "UK",
        "currency": "GBP",
        "locale": ""
    }
})
    .then((response) => {
        console.log(response)
    })
    .catch((error) => {
        console.log(error);
    });
